FARMINGTON, ME (July 10, 2024)—The University of Maine at Farmington proudly announces its Dean’s List for the Spring 2024 semester. UMF maintains a Dean’s List each semester for those students completing a minimum of 12 credits in courses producing quality points. Students whose grade point average for the semester is equal to or greater than 3.8 are listed with High Honors. Students whose grade point average for the semester is less than 3.8 but equal to or greater than 3.5 are listed with Honors. Any incompletes must be satisfactorily completed before the student is honored with Dean’s List status. Academic achievement awarded at commencement is based on all course work taken at UMF.

More on University of Maine at Farmington

A nationally recognized public liberal arts college known for its commitment to the creative arts, teacher preparation, the health arts and sciences, the environment, business and public service, UMF provides a challenging yet supportive environment to prepare students for both careers and further study. Located in the heart of Maine’s four-season outdoor recreational region, UMF is a welcoming, close-knit academic community that prepares students for enriching professional careers, engaged citizenship and an enduring love of learning.

